      | 48114 -> { ItemTypeData.id= 48114; name= "Agency 'Overclocker' SB9 Dose IV"; published= true; description= "<font color= #ff3399cc ><b>+9% Max Velocity. Duration 30 minutes.</b></font>    A novel and powerful addition to the range of neural boosters available to capsuleers, the Agency's ‘Overclocker’ compounds introduce a temporary but highly adaptive neural lace into the user’s synaptic structures. This 'Overclocker' lace increases the efficiency of navigational processing relating to spatio-temporal drag factors and effectively increases subwarp velocity as the piloted ship takes greater advantage of local space-time topology.    Compounds with the Agency identifier are being seeded into target locations identified by the mysterious network ahead of sponsored operations. Entities occupying the target sites often collect the Agency's support drops themselves even if they realize what they must portend. The Agency’s novel method of supporting capsuleer operations is thought to be as much an experiment as it is an incentive for freelance pilots to take up the public contracts."; marketGroupId= Some(2504); groupId= 303; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 161; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 162; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 4; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 38; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 330; value= 1800000.000000 }; { DogmaAttributeValueData.attributeId = 315; value= 9.000000 }; { DogmaAttributeValueData.attributeId = 1087; value= 11.000000 } |]; dogmaEffects= [| { DogmaEffectValueData.effectId = 394; isDefault = false } |]; capacity= 0.000000; graphicId= None; mass= 1.000000; packagedVolume= 1.000000; portionSize= 1; radius= 1.000000; volume= 1.000000 } |> Some
