      | 49957 -> { ItemTypeData.id= 49957; name= "Dominix Yoiul Festival YC121 SKIN"; published= true; description= "The annual Yoiul Festival celebrates the closing of one year and the start of another in New Eden's universal calendar, as adopted by all the empires 121 years ago at the Yoiul Conference. CONCORD has long sponsored and celebrated the Yoiul Festival and over time it has been adopted and marked as a holiday across the four empires. It is particularly significant for those who make their living in space, whether aboard a spaceship or the many space installations of New Eden."; marketGroupId= Some(1966); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 50151 -> { ItemTypeData.id= 50151; name= "Nyx Caille Neon SKIN"; published= true; description= "The permanently crowded streets of Caille are lit by uncounted kilometers of neon lighting by night. Indeed, some sections of the cultural capital of the Gallente Federation are so deep within the canyon-like avenues of the Caille megalopolis that they are streaked through with neon colours at every hour of the day. This pattern is seen in many Gallente cities but Caille remains the most astonishing example in the Federation.    The Caille Neon nanocoating echoes and celebrates the glowing vibrancy of Federation streetlife, providing a striking livery option for pilots of Gallente ships."; marketGroupId= Some(1976); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 52188 -> { ItemTypeData.id= 52188; name= "Women's 'Eico Redwire XVI' Facial Augmentation"; published= true; description= "Released in YC121, this special edition entry in the Eico augmentation series celebrates Capsuleer Day XVI.    Environmental information capture overlays go several steps beyond somatosensory meshes and considerably enhance the sensory capabilities of those  wearing  such extensive facial augmentations. While this level of cybernetics can hardly be masked by mere nanocoatings there is still considerable scope for working in decorative elements.    Eico augmentations include systems that improve the connection between an augmented individual's consciousness and their nervous-emotional responses. However, these more extensive and elaborate information capture and processing systems hugely increase the types and range of environmental information that can be absorbed by an individual.    Whether sipping cocktails in the zero-g bars of Caille, or ripping apart the sputtering remains of a pirate vessel with your guns in nullsec, one thing will be certain: those who see your face will have it etched into their memory forever."; marketGroupId= Some(1836); groupId= 1670; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.500000; packagedVolume= 0.100000; portionSize= 1; radius= 1.000000; volume= 0.100000 } |> Some
      | 52285 -> { ItemTypeData.id= 52285; name= "Drake Argyros Elite XVI SKIN"; published= true; description= "The Argyros Elite XVI ship nanocoating is a special release for popular battlecruisers of each empire to celebrate the 16th Capsuleer Day.    Capsuleers were given independent licenses 16 years ago and the YC121 celebrations mark this latest anniversary of the dawn of the Capsuleer Age and the opening up of New Eden's frontiers by immortal space pilots. Capsuleer Day XVI is a moment of celebration for  The Elite  pilots who are all capsuleers across New Eden."; marketGroupId= Some(1957); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 52479 -> { ItemTypeData.id= 52479; name= "Sudenic Kikimora"; published= false; description= "A light, long-range combat ship that may be considered the Collective's approach to standoff destroyer designs, the Kikimora is capable of mounting Light Entropic Disintegrators and an array of support weapons.  This particular Kikimora variant appears to be engineered towards damage application and remote repair capabilities.    <i>Kikimora Subclade of Svarog Clade revised adaptation schema for cladeship of the 9 tactical troika classification has been accepted for imprinting in advancing-time generations after reverse-time reclamation following audience communion with reverse-time proving from ancient noema. Tactical subrole dispersal is subject to suspended-time pressure contingent on proving anew.</i> – partial translation of data included in recovered design schematics of the Kikimora."; marketGroupId= None; groupId= 4028; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 192; value= 5.000000 }; { DogmaAttributeValueData.attributeId = 4; value= 1350000.000000 }; { DogmaAttributeValueData.attributeId = 645; value= 1.500000 }; { DogmaAttributeValueData.attributeId = 646; value= 2.000000 }; { DogmaAttributeValueData.attributeId = 263; value= 1000.000000 }; { DogmaAttributeValueData.attributeId = 264; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 9; value= 1300.000000 }; { DogmaAttributeValueData.attributeId = 267; value= 0.490000 }; { DogmaAttributeValueData.attributeId = 268; value= 0.640000 }; { DogmaAttributeValueData.attributeId = 269; value= 0.510000 }; { DogmaAttributeValueData.attributeId = 270; value= 0.600000 }; { DogmaAttributeValueData.attributeId = 271; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 272; value= 0.500000 }; { DogmaAttributeValueData.attributeId = 273; value= 0.600000 }; { DogmaAttributeValueData.attributeId = 274; value= 0.800000 }; { DogmaAttributeValueData.attributeId = 665; value= 8000.000000 }; { Do