      | 52770 -> { ItemTypeData.id= 52770; name= "Confessor Crown and Swords SKIN"; published= true; description= " As Holy Amarr marks the end of the third year of the reign of Her Most Sublime and Imperial Majesty Catiz I, First Apostle of the True Faith and Sovereign Defender of the Imperial Rite, the Theology Council's Supreme Sobor of Theology affirms the divine inspiration of the Empress's <i>Pax e Kilizhi Do</i> and promulgates it to all who shelter within the embrace of Holy Amarr and the Imperial Rite.  – Theology Council notice of the publication of the <i>Pax e Kilizhi Do</i>, or  Peace of the Two Swords , on the third anniversary of Empress Catiz I's coronation.    This nanocoating celebrates both the third anniversary of the coronation of Empress Catiz I and the publication of the theological work setting out the doctrine of the Peace of the Two Swords in a new addition to Amarr Scripture titled <i>Pax e Kilizhi Do</i>. The work articulates the vision of Empress Catiz I for the Amarr Empire's future and her invocation of the ancient doctrine that the ruler of the Empire wields the sword of spiritual authority alongside a sword of temporal power."; marketGroupId= Some(2310); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 52867 -> { ItemTypeData.id= 52867; name= "Scythe Snowline Bladeracer SKIN"; published= true; description= "In the icy climes of the Northern Mikramurka on Matar there are many traditional forms of transport that take advantage of the snow and ice fields to be found there. One of the most celebrated is still found as a traditional sport around the seismically active western interior of that region.    The  bladeracer  sled competitions are usually held on the relatively gentle slopes of the dormant shield volcanoes typically found in the area. The climate means that the upper reaches of the volcanoes are covered in snow and ice all year round but the lower areas remain rather fertile and are warmed by vents. The consequent profusion of heathers and mosses give the hills and slopes their characteristic purple coloration during the  warm  season."; marketGroupId= Some(1993); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
