      | 53158 -> { ItemTypeData.id= 53158; name= "Manticore Zento Isideko Combine SKIN"; published= true; description= "Now owned by the Sukuuvestaa megacorp, the Zento Isideko Combine represents the final fate of an old industrial concern from the early corporate era of Caldari society. Founded in the wave of corporate developments and consolidations of earlier business forms in the decades that followed first contact with the Gallente, Zento Isideko Combine was typical in its aspiration to become an interplanetary conglomerate in an era of enormous cultural and technological upheaval for the Caldari people.    Led by their visionary founder Foss Kriistavaa, the Zento Isideko Combine rapidly became a leader in the construction of advanced transportation links across Caldari Prime and eventually realized the founding ambition of becoming an space-industrial powerhouse. Zento Isideko maintained its place in the upper tier of Caldari corporations for nearly 200 years, until the <i>Third Sontogi Oskkaltiovone</i>* of 22714 AD brought it within the sphere of a corporate grouping that would eventually become the Sukuuvestaa Corporation.    After various corporate permutations over the centuries, the business is generally known as SuVee ZenIko on the stock markets. Even so, the old Zento Isideko Combine brand and livery is still used to distinguish the support fleets of the transportation construction, maintenance and security operations that the division carries out across the extensive holdings of Sukuuvestaa.    (<i>Sontogi Oskkaltiovone</i> – loosely translated: rules-based corporate war of takeovers)"; marketGroupId= Some(2052); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 53643 -> { ItemTypeData.id= 53643; name= "Archon Oasis of Faith SKIN"; published= true; description= "<i> Faith is an oasis from which we must draw in order to live. Like an oasis, faith is a gift from the Lord that must be shared with all.    Like an oasis, faith must be used with measure and not wasted. Like an oasis, faith should be at the center of a garden.    For it is only in the garden of a just and truthful society, watered by well measured faith, that we may cultivate the spirit of the people. </i>    – The Scriptures, Seventh Letter of St. Junip of Aerui"; marketGroupId= Some(1974); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 53837 -> { ItemTypeData.id= 53837; name= "Dragonaurs Staging Facility"; published= false; description= "This deep space staging facility has been constructed by the Templis Dragonaurs to expand their influence within low security space. CONCORD encourages capsuleers to strike these facilities when possible.    <b>Only a limited selection of capsuleer ship types are able to enter the acceleration gate leading deeper into the facility:</b>  Bellicose, Caracal, Caracal Navy Issue, Gila, Orthrus, Osprey Navy Issue, Scythe Fleet Issue, Cerberus, Sacrilege, Vangel, Chameleon, Enforcer, Rapier, Rook, Onyx, Cyclone, Drake, Drake Navy Issue, Gnosis, Claymore, Damnation, Nighthawk, Barghest, Praxis, Rattlesnake, Raven, Raven State Issue, Scorpion Navy Issue, Typhoon, Typhoon Fleet Issue, Marshal, Widow, Golem    The Templis Dragonaurs are an ultra-nationalist Caldari organization considered terrorists by most governments of New Eden. The Templis Dragonaurs reached the zenith of their influence when former member Tibus Heth brought their paramilitary units under control of his Caldari Providence Directorate government. While many Dragonaurs were rooted out following the fall of Heth and the Provists, it is believed they maintain large numbers of infiltrators and agents throughout the Caldari State and its megacorps."; marketGroupId= None; groupId= 310; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 161; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 162; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 4; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 38; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 1158; value= 1.000000 } |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= Some(1211); mass= 1.000000; packagedVolume= 1.000000; portionSize= 1; radius= 1.000000; volume= 1.000000 } |> Some
      | 53934 -> { ItemTypeData.id= 53934; name= "Carousing Talwar"; published= false; description= "The Talwar is redolent of the renowned Minmatar practicality in terms of battle. Irrespective of numbers, firepower and circumstances, their strategy when engaged in combat often revolves around the same central tenet: Stay untouchable as much as you can, either by sneaking around or rushing in, do as much damage as fast as you can, and get out before you get killed.    As such, the Talwar does not come equipped to hang around forever on the battlefield. It is built to rush around at speed without getting caught, and to hit very hard and very, very fast."; marketGroupId= None; groupId= 1664; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 4; value= 1650000.000000 }; { DogmaAttributeValueData.attributeId = 645; value= 3.000000 }; { DogmaAttributeValueData.attributeId = 646; value= 3.000000 }; { DogmaAttributeValueData.attributeId = 263; value= 530.000000 }; { DogmaAttributeValueData.attributeId = 264; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 265; value= 1060.000000 }; { DogmaAttributeValueData.attributeId = 267; value= 0.330000 }; { DogmaAttributeValueData.attributeId = 268; value= 0.520000 }; { DogmaAttributeValueData.attributeId = 269; value= 0.430000 }; { DogmaAttributeValueData.attributeId = 270; value= 0.370000 }; { DogmaAttributeValueData.attributeId = 271; value= 0.920000 }; { DogmaAttributeValueData.attributeId = 272; value= 0.460000 }; { DogmaAttributeValueData.attributeId = 273; value= 0.560000 }; { DogmaAttributeValueData.attributeId = 274; value= 0.740000 }; { DogmaAttributeValueData.attributeId = 665; value= 30000.000000 }; { DogmaAttributeValueData.attributeId = 161; value= 28100.000000 }; { DogmaAttributeValueData.attributeId = 162; value= 150.000000 }; { DogmaAttributeValueData.attributeId = 37; value= 1508.000000 }; { DogmaAttributeValueData.attributeId = 38; value= 265.000000 }; { DogmaAttributeValueData.attributeId = 55