      | 54807 -> { ItemTypeData.id= 54807; name= "Encrypted Semiosis Console (Svarog Clade)"; published= true; description= "This device is clearly a version of the Semiosis Conduction Consoles found in certain locations within Abyssal Deadspace but appears to be secured with additional layers of formidable encryption.    Like other Semiosis Consoles, this self-contained unit combines a number of sophisticated interfaces with internal processing and storage capacity geared towards symbolic or conceptual modelling. The device provides for communication of constructed models either through its built-in holographic and nanomemetic functions, or via a variety of outputs if these are connected to an appropriate network. The device almost certainly incorporates quantum entanglement communications technology.    This particular console displays the symbol of the  Svarog Clade  when connected to the correct power supply format but the encryption makes it doubtful that anything else of meaningful value could be derived from the device.    <b>CONCORD would no doubt prefer this device be handed over to them but the curious could probably keep it and carefully monitor it. It remains to be seen what the point would be given the encryption layers, and the risks may be very high.</b>"; marketGroupId= None; groupId= 2026; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 1.000000; packagedVolume= 1.000000; portionSize= 1; radius= 1.000000; volume= 1.000000 } |> Some
      | 54904 -> { ItemTypeData.id= 54904; name= "Nestor Eden's Hunters SKIN"; published= true; description= "Eager to support and promote the efforts of capsuleers hunting Triglavian structures and vessels, EDENCOM commissioned the design of a unique nanocoating for use on ships piloted by capsuleers aggressively taking the fight to the enemy. The  Eden's Hunters  nanocoating displays clearly the allegiance of capsuleer seek, destroy and salvage teams to the cause of the New Eden Common Defense Initiative. Funds from the sale of this nanocoating will go directly to the New Eden Defense Fund, aiding the struggle against the invaders."; marketGroupId= Some(1963); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
